Let's first take a look at how LeetCode define the LinkedList in rust #[derive(PartialEq, Eq, Clone, Debug)]
pub struct ListNode { pub val: i32, pub next: Option<Box<ListNode>>,
} As LeetCode is using Box as the pointer to point to the next node. It does not allow multiple reference to the same node and does not allow interior mutability. Hence, to make our life easier, we would like to change the ListNode definition to: #[derive(PartialEq, Eq, Clone, Debug)]
pub struct MutListNode { pub val: i32, pub next: Option<Rc<RefCell<MutListNode>>>,
} With Rc<T>, we allow multiple ownership to the same MutListNode With RefCell<T>, we allow interior mutability for the heap allocated MutListNode To convert between the LeetCode official ListNode and the mutable multi-referencing MutListNode we would need the following conversion utility functions From Option<Box<ListNode>> to Option<Rc<RefCell<MutListNode>>> fn to_mut_list_node(node: Option<Box<ListNode>>) -> Option<Rc<RefCell<MutListNode>>> { match node { None => None, Some(node) => Some(Rc::new(RefCell::new(MutListNode { val: node.val, next: to_mut_list_node(node.next), }))), }
} From Option<Rc<RefCell<MutListNode>>> to Option<Box<ListNode>> fn to_list_node(node: Option<Rc<RefCell<MutListNode>>>) -> Option<Box<ListNode>> { match node { None => None, Some(node) => Some(Box::new(ListNode { val: node.borrow().val, next: to_list_node(node.borrow().next.clone()), })), }
}

